void CConfig::SetupValue(int &value, int def, std::string category, std::string name)
{
	value = def;
	ints.push_back(new ConfigValue<int>(category, name, &value));
}

void CConfig::SetupValue(float &value, float def, std::string category, std::string name)
{
	value = def;
	floats.push_back(new ConfigValue<float>(category, name, &value));
}

void CConfig::SetupValue(bool &value, bool def, std::string category, std::string name)
{
	value = def;
	bools.push_back(new ConfigValue<bool>(category, name, &value));
}



void CConfig::Save()

{

	static TCHAR path[MAX_PATH];

	std::string folder, file;



	if (SUCCEEDED(SHGetFolderPath(NULL, CSIDL_MYDOCUMENTS, NULL, 0, path)))

	{





		folder = std::string(path) + ("\\Funware.cc\\");

		switch (g_Options.Menu.ConfigFile)

		{

		case 0: file = std::string(path) + ("\\Funware.cc\\") + std::string("Legit") + XorStr(".ini"); break;
		case 1: file = std::string(path) + ("\\Funware.cc\\") + std::string("Legit2") + XorStr(".ini"); break;
		case 2: file = std::string(path) + ("\\Funware.cc\\") + std::string("Rage") + XorStr(".ini"); break;
		case 3: file = std::string(path) + ("\\Funware.cc\\") + std::string("Rage2") + XorStr(".ini"); break;
		case 4: file = std::string(path) + ("\\Funware.cc\\") + std::string("HvH") + XorStr(".ini"); break;
		case 5: file = std::string(path) + ("\\Funware.cc\\") + std::string("HvH2") + XorStr(".ini"); break;
		case 6: file = std::string(path) + ("\\Funware.cc\\") + std::string("Scout") + XorStr(".ini"); break;
		case 7: file = std::string(path) + ("\\Funware.cc\\") + std::string("Scout2") + XorStr(".ini"); break;
		case 8: file = std::string(path) + ("\\Funware.cc\\") + std::string("Auto") + XorStr(".ini"); break;
		case 9: file = std::string(path) + ("\\Funware.cc\\") + std::string("Auto2") + XorStr(".ini"); break;
		case 10: file = std::string(path) + ("\\Funware.cc\\") + std::string("Pistol") + XorStr(".ini"); break;
		case 11: file = std::string(path) + ("\\Funware.cc\\") + std::string("Pistol2") + XorStr(".ini"); break;

		}



	}



	CreateDirectory(folder.c_str(), NULL);



	for (auto value : ints)

		WritePrivateProfileString(value->category.c_str(), value->name.c_str(), std::to_string(*value->value).c_str(), file.c_str());



	for (auto value : floats)

		WritePrivateProfileString(value->category.c_str(), value->name.c_str(), std::to_string(*value->value).c_str(), file.c_str());



	for (auto value : bools)

		WritePrivateProfileString(value->category.c_str(), value->name.c_str(), *value->value ? "true" : "false", file.c_str());

}

void CConfig::Load()
{
	static TCHAR path[MAX_PATH];

	std::string folder, file;



	if (SUCCEEDED(SHGetFolderPath(NULL, CSIDL_MYDOCUMENTS, NULL, 0, path)))

	{

		folder = std::string(path) + ("\\Funware.cc\\");

		switch (g_Options.Menu.ConfigFile)

		{

		case 0: file = std::string(path) + ("\\Funware.cc\\") + std::string("Legit") + XorStr(".ini"); break;
		case 1: file = std::string(path) + ("\\Funware.cc\\") + std::string("Legit2") + XorStr(".ini"); break;
		case 2: file = std::string(path) + ("\\Funware.cc\\") + std::string("Rage") + XorStr(".ini"); break;
		case 3: file = std::string(path) + ("\\Funware.cc\\") + std::string("Rage2") + XorStr(".ini"); break;
		case 4: file = std::string(path) + ("\\Funware.cc\\") + std::string("HvH") + XorStr(".ini"); break;
		case 5: file = std::string(path) + ("\\Funware.cc\\") + std::string("HvH2") + XorStr(".ini"); break;
		case 6: file = std::string(path) + ("\\Funware.cc\\") + std::string("Scout") + XorStr(".ini"); break;
		case 7: file = std::string(path) + ("\\Funware.cc\\") + std::string("Scout2") + XorStr(".ini"); break;
		case 8: file = std::string(path) + ("\\Funware.cc\\") + std::string("Auto") + XorStr(".ini"); break;
		case 9: file = std::string(path) + ("\\Funware.cc\\") + std::string("Auto2") + XorStr(".ini"); break;
		case 10: file = std::string(path) + ("\\Funware.cc\\") + std::string("Pistol") + XorStr(".ini"); break;
		case 11: file = std::string(path) + ("\\Funware.cc\\") + std::string("Pistol2") + XorStr(".ini"); break;

		}

	}



	CreateDirectory(folder.c_str(), NULL);



	char value_l[32] = { '\0' };



	for (auto value : ints)

	{

		GetPrivateProfileString(value->category.c_str(), value->name.c_str(), "", value_l, 32, file.c_str());

		*value->value = atoi(value_l);

	}



	for (auto value : floats)

	{

		GetPrivateProfileString(value->category.c_str(), value->name.c_str(), "", value_l, 32, file.c_str());

		*value->value = (float)atof(value_l);

	}



	for (auto value : bools)

	{

		GetPrivateProfileString(value->category.c_str(), value->name.c_str(), "", value_l, 32, file.c_str());

		*value->value = !strcmp(value_l, "true");

	}
}

